%[text] # Working with uDALES facet data in MATLAB
%[text] In this tutorial we cover how to work with uDALES facet data. This pertains to all surface quanties, e.g. shear stress, surface pressure, surface energy balance terms and the temperature inside each of the facets.
%[text] The **`udbase`** post-processing class reads in most important input parameters, and contains a number of methods to work with facet data:
%[text] - [**calculate\_frontal\_properties**](internal:H_7a43). This method calculates the skylines, frontal areas and blockage ratios in the x- and y-direction.
%[text] - [**plot\_bulding\_ids**](internal:H_337d). This method displays a 2d map with the building ids of the domain.
%[text] - [**plot\_2dmap**](internal:H_9b15). This method displays a 2d map with coloring and optional labels.
%[text] - [**plot\_fac\_type**](internal:H_9b15). This method displays the type of surface for each facet.
%[text] - [**assign\_prop\_to\_fac**](internal:H_69fe). This method assigns a property of the facet type to each of the facets, so it can be used for calculation and visualisation
%[text] - [**plot\_fac**](internal:H_9a84). This method displays a surface variable on the surface mesh.
%[text] - [**load\_fac\_momentum**](internal:H_7973). This method loads instantaneous momentum surface data from `fac.expnr.nc`. The first index is the facet id and second index is time.
%[text] - [**load\_fac\_eb**](internal:H_087a). This method loads instantaneous surface energy balance data from `facEB.expnr.nc`. The first index is the facet id and second index is time.
%[text] - [**load\_seb**](internal:H_44c6). This method loads all instantaneous surface energy balance terms. The first index is the facet id and second index is time.
%[text] - [**load\_fac\_temperature**](internal:H_5cd7). This method loads instantaneous facet temperature data `facT.expnr.nc`. The first index is the facet id, the second is the layer index and the third index is time.
%[text] - [**area\_average\_seb**](internal:H_6240). This method calculates the area-averaged surface energy balance from the facet surface energy balances obtained using `load_seb`.
%[text] - [**area\_average\_fac**](internal:H_64c8). This method performs area-averaging over (a selection of) the facets. The facet index is assumed to be the first index of the array.
%[text] - [**convert\_facvar\_to\_field**](internal:H_1992). This method transfers a facet variable onto the grid, so it can be used for post-processing.
%[text] - [**convert\_facflx\_to\_field**](internal:H_1761). This method converts a facet variable to a density in a 3D field, so it can be used for post-processing (e.g. calculating distributed drag). \
%[text] **The live matlab file of this tutorial can be found in the repository in the folder /docs/tutorial\_mlx.**
%[text] ## Initialising udbase
%[text] The starting point of this tutorial is that you have run a simulation and have merged the output files. If the simulations were performed on a HPC system, **we assume that you have copied the output directory to your own workstation**. Some of the netCDF (\*.nc) files may be very large and you may only want to copy these if you plan to analyse the data.
%[text] **Note that the uDALES/tools/matlab path must be added via the Set Path button in order to use the udbase class. Alternatively, it can be added using the addpath function inside the script (done here).**

% preamble
clear variables
close all

% add the uDALES matlab path
addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')

% create an instance of the udbase class
expnr = 065;
expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\065';

sim = udbase(expnr, expdir);
%%
%[text] %[text:anchor:H_7a43] ## calculate\_frontal\_properties: calculate skyline, blockage ratio and frontal areas
help sim.calculate_frontal_properties; %[output:1dd61fb0]
%[text] This method calculates the frontal areas and blockage ratios in the x- and y-direction. Here, the frontal area represents the surface area projected *summed over each individual building* in the domain. In order to calculate the blockage ratio, we first calculate the skyline (see below in black) and determine the fraction of the image that is not occupied by fluid (white). 
res = sim.calculate_frontal_properties(); %[output:509d0d7d]
res %[output:474ab8d7]
%[text] Let's plot the skyline in the x- and y-direction
figure %[output:316a665f]
subplot(1,2,1) %[output:316a665f]
pcolor(sim.yt, sim.zt, res.skylinex') %[output:316a665f]
shading flat %[output:316a665f]
colormap(flipud(colormap('gray'))) %[output:316a665f]
xlabel('y [m]','Interpreter','latex') %[output:316a665f]
ylabel('z [m]','Interpreter','latex') %[output:316a665f]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:316a665f]
axis equal tight %[output:316a665f]
title('skyline in x-direction') %[output:316a665f]

subplot(1,2,2) %[output:316a665f]
pcolor(sim.xt, sim.zt, res.skyliney') %[output:316a665f]
shading flat %[output:316a665f]
colormap(flipud(colormap('gray'))) %[output:316a665f]
xlabel('x [m]','Interpreter','latex') %[output:316a665f]
ylabel('z [m]','Interpreter','latex') %[output:316a665f]
axis equal tight %[output:316a665f]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:316a665f]
title('skyline in y-direction') %[output:316a665f]
%%
%[text] %[text:anchor:H_337d] ## plot\_building\_ids: display the building ids in the domain
help sim.plot_building_ids %[output:25745686]
%[text] 
%[text] This method displays the ids of the individual buildings inside the domain, buildings are numbered from left-bottom to right-top.
figure
sim.plot_building_ids() %[output:3d3cb9de] %[output:9a2e8abd]
xlim([0 sim.xlen]) %[output:9a2e8abd]
ylim([0 sim.ylen]) %[output:9a2e8abd]
%[text] %[text:anchor:H_9b15] ## plot\_2dmap: display 2dmap
help sim.plot_2dmap %[output:4de6c33c]
%[text] This plot creates maps showing the 2d building outline, together with some text
% get individual building information from the udgeom instance, the
% buildings ids are ordered according to their centroid.

buildings = sim.geom.get_buildings();

% calculate the maximum height for each building
ids = cell(length(buildings), 1);
hmax = zeros(size(buildings));
for i = 1:length(buildings)
    bld = buildings{i};
    hmax(i) = max(bld.Points(:,3));
    ids{i} = num2str(i);
end

% plot the result
figure
sim.plot_2dmap(hmax, ids) %[output:42cb12d0]
colorbar %[output:42cb12d0]
xlim([0 sim.xlen]) %[output:42cb12d0]
ylim([0 sim.ylen]) %[output:42cb12d0]
title('maximum building height') %[output:42cb12d0]

%[text] The function `format_surface_plot` applies a consistent layout to the surface plots. Its implementation 
%[text] %[text:anchor:H_9b15] ## plot\_fac\_type: display surface types
help sim.plot_fac_type %[output:946ca0d9]
%[text] When working with a surface energy balance model, each facet will have a specific wall type with its own properties (albedo, emissivity, thickness etc). The wall types of the geometry can be conveniently displayed using the method `plot_fac_type`:
figure %[output:47b5c0a6]
sim.plot_fac_type() %[output:47b5c0a6]
format_surface_plot('', 'SkipColorbar', true) %[output:47b5c0a6]
%[text] The function `format_surface_plot` applies a consistent layout to the surface plots. Its implementation is given at the end of the tutorial. 
%%
%[text] %[text:anchor:H_69fe] ## assign\_prop\_to\_fac: assigning wall properties to facets
help sim.assign_prop_to_fac %[output:379bcf45]
%[text] The wall type of each facet assigns properties to it which are stored in the `factypes` structure.
sim.factypes %[output:72e1accd]
%[text] Description:
%[text] - `id`: type identifier
%[text] - `name`: type name
%[text] - `lGR`: boolean that indicates whether or not there is evaporation on the facet
%[text] - `z0`: \[m\] momentum roughness length for wall-function
%[text] - `z0h`: \[m\] heat roughness length for wall-function
%[text] - `al`: \[-\] surface albedo
%[text] - `em`: \[-\] surface emissivity
%[text] - `d`: \[m\] thickness of each layer inside the facet
%[text] - `C`: \[J/m3K\] volumetric heat capacity of each layer inside the facet.
%[text] - `lam`: \[W/mK\] thermal conductivity on each cell face inside the facet. \
%[text] In order to assign these properties to each facet, use the method `assign_prop_to_fac`. For example, to assign the albedo to each surface facet:
albs = sim.assign_prop_to_fac('al');
%%
%[text] %[text:anchor:H_9a84] ## plot\_fac: plot facet quantities
help sim.plot_fac %[output:55a2cad7]
%[text] We can now plot the albedo using the method `plot_fac`.
figure %[output:9ff0774b]
sim.plot_fac(albs) %[output:9ff0774b]
format_surface_plot('$\alpha$ [-]') %[output:9ff0774b]
clim([0, 0.5]) %[output:9ff0774b]
xlim([0 sim.xlen]) %[output:9ff0774b]
ylim([0 sim.ylen]) %[output:9ff0774b]
%[text] Note that we can also choose to plot only the information for building 1.
figure %[output:0088330a]
sim.plot_fac(albs, 1) %[output:0088330a]
format_surface_plot('$\alpha$ [-]') %[output:0088330a]
clim([0, 0.5]) %[output:0088330a]
xlim([0 sim.xlen]) %[output:0088330a]
ylim([0 sim.ylen]) %[output:0088330a]
%[text] ... or for both buildings:
figure %[output:8eb540e8]
sim.plot_fac(albs, [1 2]) %[output:8eb540e8]
format_surface_plot('$\alpha$ [-]') %[output:8eb540e8]
clim([0, 0.5]) %[output:8eb540e8]
xlim([0 sim.xlen]) %[output:8eb540e8]
ylim([0 sim.ylen]) %[output:8eb540e8]
%%
%[text] %[text:anchor:H_7973] ## load\_fac\_momentum: load facet pressure and shear stresses
help sim.load_fac_momentum %[output:3c4c3cf2]
%[text] Surface information about shear and pressure can be obtained using the method `load_fac_momentum`. Calling it without parameters shows the data inside the file:
sim.load_fac_momentum; %[output:1a51bbc7]
%[text] Now we load the pressure data using the `load_fac_momentum` method and visualise it using the `plot_fac` method.
pres = sim.load_fac_momentum('pres');

figure %[output:58dfd7e6]
sim.plot_fac(pres(:,end)) %[output:58dfd7e6]
format_surface_plot('$p$ [m$^{2}$s$^{-2}$]') %[output:58dfd7e6]
%%
%[text] %[text:anchor:H_087a] ## load\_fac\_eb: load term from the surface energy balance
help sim.load_fac_eb %[output:7f50dce2]
%[text] l`oad_fac_eb` is a low-level routine that reads individual variables from the surface energy balance file `facEB.expnr.nc`. It is recommended to use the method `load_seb` which loads all surface energy balance terms at the same time.
%[text] The variables in `facEB.expnr.nc` are: 
sim.load_fac_eb(); %[output:2141238b]
%[text] Let's load and plot the net shortwave radiation at the end time
Kstar = sim.load_fac_eb('netsw');

figure %[output:5b2670bd]
sim.plot_fac(Kstar(:,end)) %[output:5b2670bd]
format_surface_plot('$K^*$ [Wm$^{-2}$]') %[output:5b2670bd]
%%
%[text] %[text:anchor:H_44c6] ## load\_seb: load all surface energy balance terms
help sim.load_seb %[output:24c88487]
%[text] the method `load_seb` loads all energy balance terms including surface temperature at once and is the preferred way of working with terms in the surface energy balance.
seb = sim.load_seb() %[output:7c721ee3]
%[text] Let's plot all components of the surface energy balance at the last timestep
figure %[output:29a53abf]
subplot(3,2,1) %[output:29a53abf]
sim.plot_fac(seb.Kstar(:,end)) %[output:29a53abf]
format_surface_plot('$K^*$ [Wm$^{-2}$]') %[output:29a53abf]
subplot(3,2,2) %[output:29a53abf]
sim.plot_fac(seb.Lstar(:,end)) %[output:29a53abf]
format_surface_plot('$L^*$ [Wm$^{-2}$]') %[output:29a53abf]
subplot(3,2,3) %[output:29a53abf]
sim.plot_fac(seb.H(:,end)) %[output:29a53abf]
format_surface_plot('$H$ [Wm$^{-2}$]') %[output:29a53abf]
subplot(3,2,4) %[output:29a53abf]
sim.plot_fac(seb.E(:,end)) %[output:29a53abf]
format_surface_plot('$E$ [Wm$^{-2}$]') %[output:29a53abf]
subplot(3,2,5) %[output:29a53abf]
sim.plot_fac(seb.G(:,end)) %[output:29a53abf]
format_surface_plot('$G$ [Wm$^{-2}$]') %[output:29a53abf]
subplot(3,2,6) %[output:29a53abf]
sim.plot_fac(seb.Tsurf(:,end)) %[output:29a53abf]
format_surface_plot('$T_{surf}$ [K]') %[output:29a53abf]
%%
%[text] %[text:anchor:H_5cd7] ## load\_fac\_temperature: load temperatures inside facets
help sim.load_fac_temperature %[output:31c0f0a9]
%[text] The following information is available about the temperature inside facets:
sim.load_fac_temperature(); %[output:9afb3f5b]
%[text] This data can be used to explore what goes on inside each facet. As an example, let's plot the time-evolution of temperature inside facet 1:
% load time, temperature data and layer thicknesses
t = sim.load_fac_temperature('t');
T = sim.load_fac_temperature('T');
d = sim.assign_prop_to_fac('d'); % retrieve facet layer thicknesses

facid = 1;
tsel = t(1:1000:end);
Tsel = squeeze(T(facid, :, 1:1000:end));
x = [0, cumsum(d(facid, :))]; % temperature is defined on cell faces

figure %[output:6f9ca241]
hold on %[output:6f9ca241]
leg = cell(size(tsel));
for n = 1:length(tsel)
    plot(x, Tsel(:, n), 'LineWidth', 1) %[output:6f9ca241]
    leg{n} = ['$t=', num2str(tsel(n), '%8.0f'), '$ s'];
end
l = legend(leg); %[output:6f9ca241]
box on %[output:6f9ca241]
l.Interpreter = 'latex'; %[output:6f9ca241]
xlabel('$x$ [m]','Interpreter','latex') %[output:6f9ca241]
ylabel('$T$ [K]','Interpreter','latex') %[output:6f9ca241]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:6f9ca241]
title('Temperature inside facet 1') %[output:6f9ca241]
%%
%[text] %[text:anchor:H_6240] ## area\_average\_seb: perform area-averaging of the surface energy balance terms
help sim.area_average_seb %[output:10007257]
%[text] This method converts the facet-by-facet surface energy balance to an area-averaged surface energy balance.
seb_av = sim.area_average_seb(seb) %[output:05c14f8a]
%[text] Check that the surface energy balance terms sum to zero:
max(abs(seb_av.Kstar+seb_av.Lstar-seb_av.H-seb_av.E-seb_av.G)) %[output:806f27ae]
%[text] This value is very small compared to the mean incoming short-wave radiation on the facets (~400 W/m2) and we therefore conclude that the surface energy balance closes. We now create a plot of the area-averaged surface energy balance.
figure() %[output:0f9e34b0]
hold on %[output:0f9e34b0]
plot(seb_av.t,seb_av.Kstar, seb_av.t,seb_av.Lstar, seb_av.t,seb_av.H, ... %[output:0f9e34b0]
     seb_av.t,seb_av.E, seb_av.t,seb_av.G, 'LineWidth',1); %[output:0f9e34b0]
xlim([0,seb_av.t(end)]) %[output:0f9e34b0]
l = legend('$K^*$','$L^*$','$H$','$E$','$G$'); %[output:0f9e34b0]
box on %[output:0f9e34b0]
l.Interpreter = 'latex'; %[output:0f9e34b0]
xlabel('$t$ [s]','Interpreter','latex') %[output:0f9e34b0]
ylabel('$\langle F \rangle_s$ [Wm$^{-2}$]','Interpreter','latex') %[output:0f9e34b0]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:0f9e34b0]
title('Area-averaged surface energy balance') %[output:0f9e34b0]
%[text] Note that this is an average over the surface. In order to obtain the surface energy balances typically used in meteorology, we will need to project this onto a flat ground using a factor $f=A\_{3D} /A\_{2D}${"editStyle":"visual"}, where $A\_{3D}${"editStyle":"visual"} is the total surface area and $A\_{2D}${"editStyle":"visual"} is the projected surface area (height x width of the domain).
% Define a factor f = A3D/A2D. 
f = sum(sim.facs.area)/(sim.xlen*sim.ylen);

% Upon multiplying the area-averaged SEB with f, the SEB represents a
% projected-area-averaged SEB term as typically presented in meteorological
% applications.  

figure() %[output:2b71ce98]
hold on %[output:2b71ce98]
plot(seb_av.t,f*seb_av.Kstar, seb_av.t,f*seb_av.Lstar, seb_av.t,f*seb_av.H, ... %[output:2b71ce98]
     seb_av.t,f*seb_av.E, seb_av.t,f*seb_av.G, 'LineWidth',1); %[output:2b71ce98]
xlim([0,seb_av.t(end)]) %[output:2b71ce98]
l = legend('$K^*$','$L^*$','$H$','$E$','$G$'); %[output:2b71ce98]
box on %[output:2b71ce98]
l.Interpreter = 'latex'; %[output:2b71ce98]
xlabel('$t$ [s]','Interpreter','latex') %[output:2b71ce98]
ylabel('$F$ [Wm$^{-2}$]','Interpreter','latex') %[output:2b71ce98]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:2b71ce98]
title('Standard surface energy balance') %[output:2b71ce98]
%[text]  
%%
%[text] %[text:anchor:H_64c8] ## area\_average\_fac: area-averaging over facet data
help sim.area_average_fac; %[output:24829fe1]
%[text] This method performs area-averaging, either over all facets or over a selection of facets.
%[text] Below we provide a non-trivial example on how to this method can be used to obtain a surface energy balance for the sidewalls in the domain. The sidewalls will be selected by using that the z-component of the surface normal has to be zero:
% Select side walls
norms = sim.geom.stl.faceNormal;
fac_ids = find(abs(norms(:, 3)) < 1e-6);

% a quick visual check
I = zeros(size(sim.facs.area));
I(fac_ids) = 1;

figure %[output:2f2d7b26]
sim.plot_fac(I) %[output:2f2d7b26]
format_surface_plot('') %[output:2f2d7b26]
%[text] This looks correct. We can now calculate and plot the area-averaged surface energy balance on the side-walls.
Kav_side = sim.area_average_fac(seb.Kstar, fac_ids);
Lav_side = sim.area_average_fac(seb.Lstar, fac_ids);
Hav_side = sim.area_average_fac(seb.H, fac_ids);
Eav_side = sim.area_average_fac(seb.E, fac_ids);
Gav_side = sim.area_average_fac(seb.G, fac_ids);

figure() %[output:0d56bc2e]
hold on %[output:0d56bc2e]
plot(seb.t,Kav_side, seb.t,Lav_side, seb.t,Hav_side, ... %[output:0d56bc2e]
     seb.t,Eav_side, seb.t,Gav_side, 'LineWidth',1); %[output:0d56bc2e]
xlim([0,seb_av.t(end)]) %[output:0d56bc2e]
l = legend('$K^*$','$L^*$','$H$','$E$','$G$'); %[output:0d56bc2e]
box on %[output:0d56bc2e]
l.Interpreter = 'latex'; %[output:0d56bc2e]
xlabel('$t$ [s]','Interpreter','latex') %[output:0d56bc2e]
ylabel('$\langle F \rangle_s$ [Wm$^{-2}$]','Interpreter','latex') %[output:0d56bc2e]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:0d56bc2e]
title('Area-averaged surface energy balance for sidewalls') %[output:0d56bc2e]
%[text] %[text:anchor:H_4d56] ## 
% average over entire time-range, merge short-term time average to
% long-term
% see utility_tutorial for functions merge_stat_var and so on
[Havt, ~] = merge_stat(seb.H, zeros(size(seb.H)), length(seb.t));

figure %[output:68bd8936]
subplot(1,2,1) %[output:68bd8936]
sim.plot_fac(Havt) %[output:68bd8936]
format_surface_plot('$H$ [Wm$^{-2}$]') %[output:68bd8936]
colorbar off %[output:68bd8936]
subplot(1,2,2) %[output:68bd8936]
sim.plot_fac(Havt) %[output:68bd8936]
format_surface_plot('$H$ [Wm$^{-2}$]') %[output:68bd8936]
colorbar off %[output:68bd8936]
%%
%[text] %[text:anchor:H_1992] ## convert\_facvar\_to\_field: convert facet data to grid
help sim.convert_facvar_to_field %[output:55916fb6]
%[text] This function assigns facet data to the grid, which is useful for some averaging and visualisation methods. For example, we can show the time-averaged surface temperature for buildings 1 and 2 and visualise the associated 3D grid locations: 
Tsav   = merge_stat(squeeze(T(:,1,:)), zeros(size(squeeze(T(:,1,:)))), length(seb.t));
Tsgrid = sim.convert_facvar_to_field(Tsav,sim.facsec.c, [1 2]);

% Get the (x, y, z) coordinates of non-zero elements
[i, j, k] = ind2sub(size(Tsgrid), find(abs(Tsgrid) > 0));
x = sim.xt(i); y = sim.yt(j); z = sim.zt(k);

% Get the corresponding values
values = Tsgrid(abs(Tsgrid) > 0);

% Plot the data using scatter3
figure; %[output:1cf9a919]
scatter3(x, y, z, 24, values, 'filled'); %[output:1cf9a919]
format_surface_plot('$T_s$ [K]'); %[output:1cf9a919]

%%
%[text] %[text:anchor:H_1761] ## convert\_facflx\_to\_field: convert facet data to 3D density field
help sim.convert_facflx_to_field %[output:3f72dc07]
%[text] This function assigns facet data to a density in a 3D field, which is useful for assessing plane-average distributed stresses \[1\] as well as the multi-scale analysis proposed by Van Reeuwijk and Huang \[2\]. For example, we can convert the time-averaged heat flux Havt to a 3d density field as follows.
rhoH = sim.convert_facflx_to_field(Havt,sim.facsec.c,sim.dzt);

% let's check whether the integrals of the 2D and 3D fields match:
s = 0;
for k = 1:size(rhoH, 3)
    s = s + sum(sum(rhoH(:,:,k)*sim.dx*sim.dy*sim.dzt(k)));
end

% calculate the relative error
abs(s - sum(Havt .* sim.facs.area)) / s %[output:14111d1b]
%[text] The relative error is extremely small which shows that the total amount of heat added to the domain is equivalent in both cases. Let's visualise the density field:
% Get the (x, y, z) coordinates of non-zero elements
[i, j, k] = ind2sub(size(rhoH), find(abs(rhoH) > 0));
x = sim.xt(i); y = sim.yt(j); z = sim.zt(k);

% Get the corresponding values
values = rhoH(abs(rhoH) > 0);

% Plot the data using scatter3
figure; %[output:11151ba1]
scatter3(x, y, z, 24, values, 'filled'); %[output:11151ba1]
format_surface_plot('$\rho_{H}$ [Wm$^{-3}$]'); %[output:11151ba1]
%[text] Here, we note that it is a coincidence that the values of the sensible heat flux density $\\rho\_{H\\;}${"editStyle":"visual"} are similar to those of the heat flux $\\bar{H\\;}${"editStyle":"visual"}itself, despite their units being different. 
%[text] We can also select specific buildings:
rhoH = sim.convert_facflx_to_field(Havt,sim.facsec.c,sim.dzt, [1, 2]);
% Get the (x, y, z) coordinates of non-zero elements
[i, j, k] = ind2sub(size(rhoH), find(abs(rhoH) > 0));
x = sim.xt(i); y = sim.yt(j); z = sim.zt(k);

% Get the corresponding values
values = rhoH(abs(rhoH) > 0);

% Plot the data using scatter3
figure; %[output:322c0b6a]
scatter3(x, y, z, 24, values, 'filled'); %[output:322c0b6a]
format_surface_plot('$\rho_{H}$ [Wm$^{-3}$]'); %[output:322c0b6a]
%[text] To calculate the horizontally-average heat flux density, we can simply average over the horizontal directions.
rhoH = sim.convert_facflx_to_field(Havt,sim.facsec.c,sim.dzt);
fH = squeeze(mean(mean(rhoH, 1), 2));
figure %[output:5e0d444e]
plot(fH, sim.zt, 'LineWidth',1); %[output:5e0d444e]
box on %[output:5e0d444e]
ylabel('$z$ [m]','Interpreter','latex') %[output:5e0d444e]
xlabel('$f_H$ [Wm$^{-3}$]','Interpreter','latex') %[output:5e0d444e]
ax = gca;
ax.TickLabelInterpreter = 'latex'; %[output:5e0d444e]
title('Distributed heat flux') %[output:5e0d444e]
%%
%[text] ## Function to format surface plots
%[text] This auxiliary function is used to ensure a consistent layout of all surface plots in this tutorial.
function format_surface_plot(strvar, varargin)
    % Parse optional parameters
    p = inputParser;
    addParameter(p, 'SkipColorbar', false, @islogical);
    parse(p, varargin{:});
    
    % Apply standard formatting
    view(-25,30)
    xlabel('$x$ [m]','Interpreter','latex')
    ylabel('$y$ [m]', 'Interpreter','latex')
    zlabel('$z$ [m]','Interpreter','latex')
    ax = gca;
    ax.TickLabelInterpreter = 'latex';
    axis equal
    
    % Only create/modify colorbar if not skipped
    if ~p.Results.SkipColorbar
        c = colorbar;
        c.Label.String = strvar;
        c.Label.Interpreter = 'latex';
        c.TickLabelInterpreter = 'latex';
    end
end
